import React, { Component } from 'react';

import Picture from '../images/profile.jpg';

import Image from 'react-image-resizer';

class ProfileImage extends Component {
    render() {
        return (
            <div>
            <Image 
            src={Picture}
            height={600}
            width={800}/>
            </div>
        )
    }
}

export default ProfileImage;
